    backgroundColor: green
}

function TodoTitle({total, completed}){ // Esta es otra manera de escrirbir los props, generando su palabra clave desde el componente
    return(
        <h1 style={styleTitle}>
            Has completado {completed} de {total} ejercicios
        </h1>
    )
}
